import React, { Component }  from 'react';
import MUIDataTable from "mui-datatables";
import {connect} from 'react-redux';
import {fetchPatients} from '../../store/actions/patients';


class PatientsList extends Component{
  constructor(props){
    super(props);
    this.state = {}
  }

  componentDidMount(){
    const { currentUserId } = this.props;
    this.props.fetchPatients(currentUserId, console.log('was fetched'));
  }


  render(){
    const { patients } = this.props;
    const columns = ["Nombre", "Edad", "Email", "Activo"];
    const data = [
     ["Joe James", "Test Corp", "Yonkers", "NY"],
     ["John Walsh", "Test Corp", "Hartford", "CT"],
     ["Bob Herm", "Test Corp", "Tampa", "FL"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"],
     ["James Houston", "Test Corp", "Dallas", "TX"]
    ];

    let patientList = patients.map(patient => {
      // ahorita solo tenemos el birthDate del paciente, age se calcularia aqui, o tb podria venir desde el back
      const { firstName, lastName, mail, age } = patient;
      return (
        [`${firstName} ${lastName}`, mail]
      )
    });

    const options = {
      filterType: 'checkbox',
      rowsPerPage: 5,
      rowsPerPageOptions: [5,10,15],
      textLabels:{
        body: '' //estp pa q cuando esten fetcheando los mensajes, aparezca en blanco el table
      }
    };  

    return(
      <MUIDataTable
        title={"Pacientes"}
        data={patientList}
        columns={columns}
        options={options}
      />
    )
  }  
}

function mapStateToProps(state){
  return{
    patients: state.patients,
    currentUserId: state.currentUser.user.id
  };
};

export default connect(mapStateToProps, { fetchPatients })(PatientsList);
